    [],nt"revision_timestamp": "2016-07-27T22:19:46.636648",nt"name": "student-trainee-report-of-walter-l-anderson",nt"isopen":
    false,nt"url": null,nt"notes": "The following report is intended to summarize
    the activities of Walter L. Anderson, Student Trainee (Wildlife Biology) at Malheur
    National Wildlife Refuge during the summer of 1966.  The studentu2019s assignments
    were of three general types: biology, public relations, and administration.  Information
    on banding golden eagles, sandhill cranes, geese, wading birds, and ducks is provided
    in this report.  Waterfowl brood counts, disease, aquatic plant surveys, noxious
    weed control, fish control, and routine maintenance are also discussed.",nt"license_title":
